
<!DOCTYPE html>
<html lang="en">
<head>
    <meta charset="UTF-8">
    <meta name="viewport" content="width=device-width, initial-scale=1, maximum-scale=1">
    <title>DM Me Privately</title>
    <style>
        * {
            margin: 0;
            padding: 0;
            box-sizing: border-box;
            -webkit-tap-highlight-color: transparent;
        }
        html, body {
            height: 100%;
            width: 100%;
            overflow: hidden;
            background: linear-gradient(120deg, #0d0d0d, #1a1a1a);
            font-family: -apple-system, BlinkMacSystemFont, 'Segoe UI', Roboto, Oxygen, Ubuntu, Cantarell, 'Open Sans', 'Helvetica Neue', sans-serif;
            color: #fff;
        }
        body::before {
            content: "";
            position: absolute;
            top: -50%;
            left: -50%;
            width: 200%;
            height: 200%;
            background: radial-gradient(circle, rgba(255,102,163,0.1) 0%, transparent 70%);
            filter: blur(80px);
            z-index: 0;
        }
        .container {
            position: relative;
            z-index: 1;
            display: flex;
            flex-direction: column;
            justify-content: center;
            align-items: center;
            padding: 20px;
            height: 100%;
            text-align: center;
        }
        .photo {
            width: 60vw;
            max-width: 240px;
            height: 60vw;
            max-height: 240px;
            border-radius: 50%;
            object-fit: cover;
            margin-bottom: 20px;
            border: 4px solid #ff66a3;
            box-shadow: 0 0 30px rgba(255, 102, 163, 0.5);
        }
        h1 {
            font-size: 5vw;
            max-font-size: 24px;
            margin-bottom: 15px;
            color: #ff66a3;
        }
        p {
            font-size: 4vw;
            max-font-size: 17px;
            margin-bottom: 25px;
            line-height: 1.6;
        }
        .btn {
            background: linear-gradient(45deg, #ff3385, #d6336c);
            color: white;
            border: none;
            padding: 15px 30px;
            border-radius: 30px;
            font-size: 4.5vw;
            max-font-size: 18px;
            font-weight: bold;
            text-decoration: none;
            margin-top: 10px;
            box-shadow: 0 5px 15px rgba(214, 51, 108, 0.5);
            transition: transform 0.3s;
        }
        .btn:active {
            transform: scale(0.95);
        }
        .disclaimer {
            font-size: 3vw;
            max-font-size: 12px;
            color: rgba(255,255,255,0.5);
            margin-top: 25px;
        }
    </style>
</head>
